})

const AddUser = ()=>{
    
    return(
        <form>
        <TextField type="text" id="outlined-basic" label="Username" variant="outlined"/>
        <TextField type="number" id="outlined-basic" label="Age(Years)" variant="outlined"/>
        </form>
    )
}

